labels: {}
# label_1: abc
# label_2: def
replicas: 2
image:
    repository: authelia/authelia
    tag: 4.38
ports:
    - containerPort: 9091
      service: true
# Uses ports from .ports section, if service is true
service:
    enabled: true
    port: 80
volumeMounts:
    - name: config
      mountPath: /config
      # readOnly: true
volumes:
    - name: config
      configMap:
        name: authelia
ingress:
    enabled: true
    # Don't enable authelia on itself
    authelia: false
    className: nginx
    annotations: {}
    # nginx.ingress.kubernetes.io/client-max-body-size: "0"
    # nginx.ingress.kubernetes.io/proxy-body-size: "0"
    tls:
        - secretName: auth-cert
    hosts:
        - host: ENC[AES256_GCM,data:zk5QoWKo2qvTaIdqfQaOiyxt,iv:EcZLWM1zUSVFFFemwVvZsh6QvLxo/eYpmsWs0noiChI=,tag:ePwguil8xmz7ZADy63/b7Q==,type:str]
          paths:
            - path: /
              pathType: Prefix
livenessProbe:
    httpGet:
        path: /verify
        port: 9091
    initialDelaySeconds: 5
    periodSeconds: 10
readinessProbe:
    httpGet:
        path: /verify
        port: 9091
    initialDelaySeconds: 5
    periodSeconds: 10
resources:
    limits:
        cpu: 100m
        memory: 128Mi
    requests:
        cpu: 20m
        memory: 64Mi
affinity:
    podAntiAffinity:
        preferredDuringSchedulingIgnoredDuringExecution:
            - weight: 1
              podAffinityTerm:
                namespaceSelector: {}
                labelSelector:
                    matchExpressions:
                        - key: app.kubernetes.io/instance
                          operator: In
                          values:
                            - mariadb
                topologyKey: kubernetes.io/hostname
